// import the library
import { library } from '@fortawesome/fontawesome-svg-core';

// import your icons
import { faCode, faHighlighter } from '@fortawesome/free-solid-svg-icons';

import {
  faGithubAlt,
  faGoogle,
  faFacebook,
  faTwitter,
  faInstagram
} from '@fortawesome/free-brands-svg-icons';

library.add(
  faUserGraduate,
  faImages,
  faGithubAlt,
  faGoogle,
  faFacebook,
  faTwitter,
  faInstagram
);
